function ping() {
    fetch('../api')
      .then(response => response.text())
      .then(data => {
          setState(data)
        });
}

ping()

ReactDOM.render(
    <div>
        <div>This page was served statically</ div>
        <div>{element}</div>
    </div>,
    document.getElementById('root')
);
